var initialValuesFnByKey = map[clusterversion.Key]initialValuesFn{
	clusterversion.V22_2: InitialValuesForTenantV222,
}

type initialValuesFn = func(
	codec keys.SQLCodec,
	defaultZoneConfig *zonepb.ZoneConfig,
	defaultSystemZoneConfig *zonepb.ZoneConfig,
) (kvs []roachpb.KeyValue, splits []roachpb.RKey, _ error)

func GetInitialValuesFn(key clusterversion.Key) initialValuesFn {
	return initialValuesFnByKey[key]
}

// InitialValuesForTenantV222 returns the initial values as produced by the
// binary for the 22.2 release, for a non-system tenant. The only difference
// is that the contents of the system.zones table are overwritten with the new
// values.
func InitialValuesForTenantV222(
	codec keys.SQLCodec,
	defaultZoneConfig *zonepb.ZoneConfig,
	defaultSystemZoneConfig *zonepb.ZoneConfig,
) (kvs []roachpb.KeyValue, splits []roachpb.RKey, _ error) {
	h := sha256.Sum256([]byte(nonSystem222))
	if actualHash := hex.EncodeToString(h[:]); actualHash != nonSystem222SHA256 {
		return nil, nil, errors.AssertionFailedf("expected %s, got %s", nonSystem222SHA256, actualHash)
	}
	var initialKVs []roachpb.KeyValue
	initialKVs, splits, err := InitialValuesFromString(codec, nonSystem222)
	if err != nil {
		return nil, nil, err
	}
	// Replace system.zones entries.
	kvs = InitialZoneConfigKVs(codec, defaultZoneConfig, defaultSystemZoneConfig)
	zonesTablePrefix := codec.TablePrefix(keys.ZonesTableID)
	for _, kv := range initialKVs {
		if !bytes.Equal(zonesTablePrefix, kv.Key[:len(zonesTablePrefix)]) {
			kvs = append(kvs, kv)
		}
	}
	sort.Sort(roachpb.KeyValueByKey(kvs))
	return kvs, splits, nil
}

